import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import Alert from 'react-bootstrap/Alert';
import ItemForm from "./ItemForm";
import './resources/Form.css'

const Energy = ({ setForm, formData, navigation }) => {
  const { no, little, fair, aLot } = formData;

  const { previous, next } = navigation;

  return (
    <div className="form">
      <h3>Hur är din allmänna ork?</h3>
      <ItemForm label="Som vanligt" name="normal" value={no} onChange={setForm} />
      <ItemForm label="Ja, jag får andnöd vid lätt ansträngning men inte i vila" name="little" value={little} onChange={setForm} />
      <ItemForm label="Ja, jag känner viss andnöd i vila" name="fair" value={fair} onChange={setForm} />
      <ItemForm label="Ja, jag känner påtaglig andnöd hela tiden" name="aLot" value={aLot} onChange={setForm} />
      <div>
        <Button onClick={previous}>Previous</Button>{' '}
        <Button onClick={next}>Next</Button>
      </div>
    </div>
  );
};

export default Energy;
